import React from "react";
import Sidebar from "../Sidebar";
import Header from "../Header";
import Body from "./Body";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllStudent } from "../../../redux/actions/adminActions";

const StudentInFo = () => {
  const user = JSON.parse(localStorage.getItem("user"));

  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getAllStudent());
  }, [dispatch]);
  const students = useSelector((state) => state.admin.allStudent);

  return (
    <div className="bg-[#d6d9e0] h-screen flex items-center ">
      <div className="flex bg-[#f4f6fa] w-full h-full overflow-y-hidden">
        <Sidebar />
        <div className="flex flex-col flex-1">
          <Header />
          <Body user={user} students={students} />
        </div>
      </div>
    </div>
  );
};

export default StudentInFo;
